import time

# Definition for singly-linked list.
class ListNode:
    def __init__(self, val=0, next=None):
        self.val = val
        self.next = next


# Definition for singly-linked list.
# class ListNode:
#     def __init__(self, val=0, next=None):
#         self.val = val
#         self.next = next
class Solution:
    def sortList(self, head: ListNode) -> ListNode:
        if head == None or head.next == None:
            return head
        # 首先得找到中间那个节点

        slow = head
        fast = head.next


        while not (fast == None or fast.next == None):
            slow = slow.next
            fast = fast.next.next

        h1 = head
        mid = slow.next
        slow.next = None



        left = self.sortList(h1)
        right = self.sortList(mid)
        a = self.merge(left, right)
        return a

    def merge(self, h1, h2):

        if h1.val < h2.val:
            small = h1
            h1 = h1.next
        else:
            small = h2
            h2 = h2.next

        res = small
        while not (h1 == None or h2 == None):
            if h1.val < h2.val:
                s = h1
                h1 = h1.next
            else:
                s = h2
                h2 = h2.next

            small.next = s
            small = small.next

        if h1 != None:
            small.next = h1
        if h2 != None:
            small.next = h2

        return res

class Solution2:
    def sortList(self, head: ListNode) -> ListNode:
        # 遍历单向链表
        # 如果遍历到的节点比新链表的尾部的节点还大，那么就接在尾部，否则，从新链表的头部开始遍历，插入适当的位置
        if head == None or head.next == None:
            return head

        h = head.next
        res = ListNode(0)
        res.next = head
        tail = head
        while h != None:
            if h.val > tail.val:
                tail.next = h
                tail = tail.next
            else:
                # 遍历新链表，把h插入合适的位置
                rf = res
                r = res.next
                temph = ListNode(h.val)
                while r != None:
                    if r.val > temph.val:
                        # 将temph插入r之前
                        # ->r->
                        # None->temph->None
                        rf.next = temph
                        temph.next = r

                        break
                    else:

                        r = r.next
                        rf = rf.next

            h = h.next
            tail.next = None
        return res.next

